import './App.css';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(() => {
    fetch("/questions")
    .then((res) => res.json())
    .then((data) => setData(data.message));
  })
  return (
    <div className="App">
        <p>
          {!data ? "loading" : data}
        </p>
    </div>
  );
}

export default App;
